import React from 'react';
import { 
    Row, 
    Card, 
    CardImg,  
    CardBody, 
    Col, 
    Container
  } from 'reactstrap';

function CardLayout(props){

    return(

        <div>
            <Container>
                <Row>
                    <Col xs="4" className ="mt-10 mb-10" >
                        <Card>
                            <CardImg top src={console.log(props)} alt=""></CardImg>
                            <CardBody>
                                <a href={props.link}>
                                {props.title}
                                </a>
                            </CardBody>
                        </Card>
                    </Col>
                </Row>
            </Container> 
        </div>
    )

}

export default CardLayout;
